import React from 'react';
import './Menu.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavItem from 'react-bootstrap/NavItem';
import NavDropdown from "react-bootstrap/NavDropdown";


class Menu extends React.Component {
    render() {
        return (
            <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
                <Navbar.Brand href={"#"}>Game-Title</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className={"ml-auto"} variant={"pills"}>
                        <Nav.Link href={"#"}>Character</Nav.Link>
                        <NavDropdown title="Fights" id="collasible-nav-dropdown">
                            <NavDropdown.Item href="#arena">Arena</NavDropdown.Item>
                            <NavDropdown.Item href="#expedition">Expedition</NavDropdown.Item>
                        </NavDropdown>
                        <NavDropdown title="NPC" id="collasible-nav-dropdown">
                            <NavDropdown.Item href="#healer">Healer</NavDropdown.Item>
                            <NavDropdown.Item href="#weapons">Weapons</NavDropdown.Item>
                            <NavDropdown.Item href="#armors">Armors</NavDropdown.Item>
                        </NavDropdown>

                        <Nav.Link href={"#manage"}>Account Management</Nav.Link>
                        <Nav.Link href={"#logout"}>Logout</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>
        );
    }
}

export default Menu;
